import pic1 from "../img/pic1.jpg" 
import axios from "axios";


const Picupload = () => {
    const [uploadcomment, setuploadcomment] = useState("");
    const [uploadtitle, setuploadtitle] = useState("");
    const [uploadingr, setuploadingr] = useState("");
    const [uploadcate, setuploadcate] = useState(""); 
    
    const postdata = (props) => {
        console.log(props);
        
    axios.post('http://api.1971artist.com:3000/posts/1',JSON.stringify({
      
      postTitle: uploadtitle,
      postIntro: uploadcomment,
      postCategory: 1,
      postIngredient:uploadingr
    }),
    {
      headers: 
        {
        
         "x-access-token" : 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJhZG1pbklkIjoxLCJpYXQiOjE2NDA2MTc5MDYsImV4cCI6MTY3MjE1MzkwNiwic3ViIjoidXNlckluZm8ifQ.aOC6HO4TRf__izxleFMD0EL-r0t9d-X22GY3Zx_Disk',
         "Content-Type": 'application/json'
        }
    }
    ).then((response) => console.log(response));
};
  const [files, setFiles] = useState("");
  const onChangeImg = async (e) => {
      e.preventDefault();
      if(e.target.files){
          const uploadFile = e.target.files[0];
          const formData = new FormData()
          formData.append('files',uploadFile)
          axios.post('http://api.1971artist.com:3000/posts/1',formData,JSON.stringify({
      
            postTitle: uploadtitle,
            postIntro: uploadcomment,
            postCategory: 1,
            postIngredient:uploadingr
          }),
          {
            headers: 
              {
              
               "x-access-token" : 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJhZG1pbklkIjoxLCJpYXQiOjE2NDA2MTc5MDYsImV4cCI6MTY3MjE1MzkwNiwic3ViIjoidXNlckluZm8ifQ.aOC6HO4TRf__izxleFMD0EL-r0t9d-X22GY3Zx_Disk',
